static
MVOID
_testTsfStatToPPM(const char* inFileName)
{
    char outFileNameRgb[512] = {'\0'};
    char outFileNameL[512] = {'\0'};
    sprintf(outFileNameRgb, "%s.rgb.ppm", inFileName);
    sprintf(outFileNameL, "%s.luma.ppm", inFileName);

    FILE* inFile = fopen(inFileName, "rb");
    FILE* outFile = fopen(outFileNameRgb, "w");
    FILE* outFileL = fopen(outFileNameL, "w");

    if (!(inFile && outFile && outFileL))
    {
        printf("alert\n");
        CAM_LOGE("Failed to open %s, %s, %s.", inFileName, outFileNameRgb, outFileNameL);
        return;
    }

    fprintf(outFile, "P3\n%d %d\n%d\n", 120, 90, 4095);
    fprintf(outFileL, "P3\n%d %d\n%d\n", 120, 90, 4095);

    MUINT16 in_r;
    MUINT16 in_g;
    MUINT16 in_b;
    MUINT16 in_l;

    MUINT16 out_r;
    MUINT16 out_g;
    MUINT16 out_b;
    MUINT16 out_l;

    for(int i=0; i < 120 * 90; i++) {             /* prints body of the ppm file */
        fread((char*)&in_r, 2, 1, inFile);
        fread((char*)&in_g, 2, 1, inFile);
        fread((char*)&in_b, 2, 1, inFile);
        fread((char*)&in_l, 2, 1, inFile);

        out_r = in_r & 0xFFF;                    // out_r = in_r % color_max;
        out_g = in_g & 0xFFF;                    // out_g = in_g % color_max;
        out_b = in_b & 0xFFF;                    // out_b = in_b % color_max;
        out_l = in_l & 0xFFF;                    // out_l = in_l % color_max;

        fprintf(outFile, "%d %d %d\n", out_r, out_g, out_b);
        fprintf(outFileL, "%d %d %d\n", out_l, out_l, out_l);
    }

    fclose(inFile);
    fclose(outFile);
    fclose(outFileL);
}

