static
MVOID
_testEmRaw16ToPGM(const char* inFileName, MINT32 width, MINT32 height, MINT32 bit_depth)
{
    char outFileNameRgb[512] = {'\0'};
    sprintf(outFileNameRgb, "%s.pgm", inFileName);

    FILE* inFile = fopen(inFileName, "rb");
    FILE* outFile = fopen(outFileNameRgb, "w");

    if (!(inFile && outFile))
    {
        CAM_LOGE("Failed to open %s, %s.", inFileName, outFileNameRgb);
        return;
    }

    fprintf(outFile, "P2\n%d %d\n%d\n", width, height, (1<<bit_depth)-1);

    MUINT32 u4Cnt = width * height;
    while (u4Cnt > 16)
    {
        MUINT16 u2Pix[16] = {0};
        fread((char*)u2Pix, 16, 2, inFile);
        fprintf(outFile, "%d %d %d %d %d %d %d %d %d %d %d %d %d %d %d %d\n",
            u2Pix[0], u2Pix[1], u2Pix[2], u2Pix[3], u2Pix[4], u2Pix[5], u2Pix[6], u2Pix[7],
            u2Pix[8], u2Pix[9], u2Pix[10], u2Pix[11], u2Pix[12], u2Pix[13], u2Pix[14], u2Pix[15]);
        u4Cnt -= 16;
    }

    while (u4Cnt != 0)
    {
        MUINT16 u2Pix = 0;
        fread((char*)&u2Pix, 1, 2, inFile);
        fprintf(outFile, "%d\n", u2Pix);
        u4Cnt --;
    }

    fclose(inFile);
    fclose(outFile);
}

