// Loads shading table in input format from input BINARY file, converts it into output format and saves it in output TEXT file.

static
MVOID
_binCvtLsc(const char* inputFile, ILscTable::TBL_TYPE_T inputType, MINT32 inputWidth, MINT32 inputHeight, MINT32 inputGridX, MINT32 inputGridY, const char* outputFile, ILscTable::TBL_TYPE_T outputType, MINT32 outputGridX, MINT32 outputGridY)
{

    FILE* pFile = fopen(inputFile, "rb");
    if (!pFile)
    {
        CAM_LOGE("Failed to open %s.", inputFile);
        return; // MFALSE;
    }

    ILscTbl input(inputType, inputWidth, inputHeight, inputGridX, inputGridY);
    ILscTbl output(outputType, inputWidth, inputHeight, outputGridX, outputGridY);

    fseek(pFile, 0, SEEK_END);
    MUINT32 size = ftell(pFile);
    fseek(pFile, 0, SEEK_SET);

    MUINT32 *inputarray = (MUINT32*) malloc(size);
    if (inputarray == NULL)
    {
        CAM_LOGE("Failed to allocate enough memory for input array.");
        fclose(pFile);
        return; // MFALSE;
    }

    fread(inputarray, size, 1, pFile);
    fclose(pFile);

    input.setData(inputarray, input.getSize());
    free(inputarray);
    input.convert(output);

    char strFile[512] = {'\0'};
    sprintf(strFile, "%s.log", outputFile);

    output.dump(outputFile);

}

