int main(int argc, char** argv)
{
    int ret = 0;
    CAM_LOGD("%s start", LOG_TAG);

    if (argc == 1)
    {
        //_testAlignXForm();
        //_testFloatConvert();
        //_testRatio();
        _testGrid200();
    }
    else if (argc == 2)
    {
        _testConvertOtp(argv[1]);
    }
    else if (argc == 3)
    {
        if (strcmp("-s2p", argv[1]) == 0)
        {
            _testTsfStatToPPM(argv[2]);
        }
        else if (strcmp("-otp", argv[1]) == 0)
        {
            _testConvertOtp(argv[2]);
        }
    }
    else if (argc == 6)
    {
        if (strcmp("-u2g", argv[1]) == 0)
        {
            _testEmRaw16ToPGM(argv[2], atoi(argv[3]), atoi(argv[4]), atoi(argv[5]));
        }
    }
    else if (argc == 7)
    {
        if (strcmp("-u2p", argv[1]) == 0)
        {
            _testEmRaw16ToPPM2(argv[2], atoi(argv[3]), atoi(argv[4]), atoi(argv[5]), atoi(argv[6]));
        }
    }
    else if (argc == 11)
    {

        MINT32 inputWidth, inputHeight, inputGridX, inputGridY, outputGridX, outputGridY;
        inputWidth = atoi(argv[3]);
        inputHeight = atoi(argv[4]);
        inputGridX = atoi(argv[5]);
        inputGridY = atoi(argv[6]);
        outputGridX = atoi(argv[9]);
        outputGridY = atoi(argv[10]);

        ILscTable::TBL_TYPE_T inputType;
        ILscTable::TBL_TYPE_T outputType;

        switch(atoi(argv[2]))
        {
            case 0/*"HWTBL"*/:
                inputType = ILscTable::HWTBL;
                break;
            case 1/*"GAIN_FIXED"*/:
                inputType = ILscTable::GAIN_FIXED;
                break;
            case 2/*"GAIN_FLOAT"*/:
                inputType = ILscTable::GAIN_FLOAT;
                break;
            default:
                CAM_LOGE("Incorrect input table type.");
                return ret;
        }

        switch(atoi(argv[8]))
        {
            case 0/*"HWTBL"*/:
                outputType = ILscTable::HWTBL;
                break;
            case 1/*"GAIN_FIXED"*/:
                outputType = ILscTable::GAIN_FIXED;
                break;
            case 2/*"GAIN_FLOAT"*/:
                outputType = ILscTable::GAIN_FLOAT;
                break;
            default:
                CAM_LOGE("Incorrect output table type.");
               return ret;
        }

        _cvtLsc(argv[1], inputType, inputWidth, inputHeight, inputGridX, inputGridY, argv[7], outputType, outputGridX, outputGridY);

    }

    CAM_LOGD("%s end", LOG_TAG);
    return ret;
}
